    super();
    this.state = {
      route: [
        {
          isClicked: false,
          path: "/webSite",
          component: WebSite,
          navBar: {
            webSiteInfo: "Web Site Info",
            credentials: "Credentials",
            status: "Status"
          }
        },
        {
          isClicked: false,
          path: "/task",
          component: WebSiteTasks
        }
      ]
    };
  }
  render() {
    return (
      <div className="container-fluid text-center">
        <div className="row content">
          <div className="col-sm-2 sidenav" />
          <ul>
            {this.props.routeState.map(route => {
              if (route.isClicked === true) {
                {
